import React, { useState, useEffect, useCallback } from 'react';
import { Link } from 'react-router-dom';
import { CalendarIcon, PlusIcon, FunnelIcon } from '@heroicons/react/24/outline';
import { useAuth } from '../../hooks/useAuth';
import { bookingService } from '../../services/bookingService';
import BookingCard from '../../components/Bookings/BookingCard';
import BookingCalendar from '../../components/Bookings/BookingCalendar';
import FilterModal from '../../components/Common/FilterModal';

const BookingList = () => {
  const { user } = useAuth();
  const [bookings, setBookings] = useState([]);
  const [loading, setLoading] = useState(true);
  const [view, setView] = useState('list'); // 'list' or 'calendar'
  const [filters, setFilters] = useState({
    status: '',
    equipment: '',
    dateRange: '',
    user: ''
  });
  const [showFilters, setShowFilters] = useState(false);

  const loadBookings = useCallback(async () => {
    try {
      setLoading(true);
      const data = await bookingService.getBookings(filters);
      setBookings(data);
    } catch (error) {
      console.error('Error loading bookings:', error);
    } finally {
      setLoading(false);
    }
  }, [filters]);

  useEffect(() => {
    loadBookings();
  }, [loadBookings]);

  const handleFilterChange = (newFilters) => {
    setFilters({ ...filters, ...newFilters });
    setShowFilters(false);
  };

  const getStatusCounts = () => {
    const counts = {
      pending: 0,
      active: 0,
      completed: 0,
      cancelled: 0
    };

    bookings.forEach(booking => {
      if (counts.hasOwnProperty(booking.status)) {
        counts[booking.status]++;
      }
    });

    return counts;
  };

  const statusCounts = getStatusCounts();

  if (loading) {
    return (
      <div className="flex items-center justify-center min-h-64">
        <div className="animate-spin rounded-full h-8 w-8 border-b-2 border-primary-600"></div>
      </div>
    );
  }

  return (
    <div className="space-y-6">
      {/* Header */}
      <div className="flex flex-col sm:flex-row sm:items-center sm:justify-between gap-4">
        <div>
          <h1 className="text-2xl font-bold text-gray-900">Buchungen</h1>
          <p className="text-gray-600">Verwalten Sie alle Equipment-Buchungen</p>
        </div>

        <div className="flex items-center gap-3">
          <button
            onClick={() => setShowFilters(true)}
            className="btn btn-secondary"
          >
            <FunnelIcon className="h-4 w-4" />
            Filter
          </button>

          <div className="flex bg-gray-100 rounded-lg p-1">
            <button
              onClick={() => setView('list')}
              className={`px-3 py-1 rounded-md text-sm font-medium transition-colors ${
                view === 'list' 
                  ? 'bg-white text-gray-900 shadow-sm' 
                  : 'text-gray-600 hover:text-gray-900'
              }`}
            >
              Liste
            </button>
            <button
              onClick={() => setView('calendar')}
              className={`px-3 py-1 rounded-md text-sm font-medium transition-colors ${
                view === 'calendar' 
                  ? 'bg-white text-gray-900 shadow-sm' 
                  : 'text-gray-600 hover:text-gray-900'
              }`}
            >
              <CalendarIcon className="h-4 w-4 inline mr-1" />
              Kalender
            </button>
          </div>

          <Link to="/bookings/new" className="btn btn-primary">
            <PlusIcon className="h-4 w-4" />
            Neue Buchung
          </Link>
        </div>
      </div>

      {/* Status Overview */}
      <div className="grid grid-cols-2 md:grid-cols-4 gap-4">
        <div className="bg-white p-4 rounded-lg border border-gray-200">
          <div className="text-2xl font-bold text-blue-600">{statusCounts.pending}</div>
          <div className="text-sm text-gray-600">Ausstehend</div>
        </div>
        <div className="bg-white p-4 rounded-lg border border-gray-200">
          <div className="text-2xl font-bold text-green-600">{statusCounts.active}</div>
          <div className="text-sm text-gray-600">Aktiv</div>
        </div>
        <div className="bg-white p-4 rounded-lg border border-gray-200">
          <div className="text-2xl font-bold text-gray-600">{statusCounts.completed}</div>
          <div className="text-sm text-gray-600">Abgeschlossen</div>
        </div>
        <div className="bg-white p-4 rounded-lg border border-gray-200">
          <div className="text-2xl font-bold text-red-600">{statusCounts.cancelled}</div>
          <div className="text-sm text-gray-600">Storniert</div>
        </div>
      </div>

      {/* Content */}
      {view === 'list' ? (
        <div className="space-y-4">
          {bookings.length === 0 ? (
            <div className="text-center py-12">
              <CalendarIcon className="mx-auto h-12 w-12 text-gray-400" />
              <h3 className="mt-2 text-sm font-medium text-gray-900">Keine Buchungen</h3>
              <p className="mt-1 text-sm text-gray-500">
                {Object.values(filters).some(f => f) 
                  ? 'Keine Buchungen mit den aktuellen Filtern gefunden.'
                  : 'Erstellen Sie Ihre erste Buchung.'
                }
              </p>
              {!Object.values(filters).some(f => f) && (
                <div className="mt-6">
                  <Link to="/bookings/new" className="btn btn-primary">
                    <PlusIcon className="h-4 w-4" />
                    Neue Buchung erstellen
                  </Link>
                </div>
              )}
            </div>
          ) : (
            <div className="grid gap-4">
              {bookings.map(booking => (
                <BookingCard key={booking._id} booking={booking} onUpdate={loadBookings} />
              ))}
            </div>
          )}
        </div>
      ) : (
        <BookingCalendar bookings={bookings} onBookingClick={(booking) => {
          // Navigate to booking detail
          window.location.href = `/bookings/${booking._id}`;
        }} />
      )}

      {/* Filter Modal */}
      <FilterModal
        isOpen={showFilters}
        onClose={() => setShowFilters(false)}
        filters={filters}
        onApply={handleFilterChange}
        filterOptions={{
          status: [
            { value: '', label: 'Alle Status' },
            { value: 'pending', label: 'Ausstehend' },
            { value: 'active', label: 'Aktiv' },
            { value: 'completed', label: 'Abgeschlossen' },
            { value: 'cancelled', label: 'Storniert' }
          ],
          dateRange: [
            { value: '', label: 'Alle Daten' },
            { value: 'today', label: 'Heute' },
            { value: 'week', label: 'Diese Woche' },
            { value: 'month', label: 'Dieser Monat' },
            { value: 'upcoming', label: 'Anstehend' }
          ]
        }}
      />
    </div>
  );
};

export default BookingList;
